            if (lhs == null || rhs == null) return false;
            if ((crystal?.GetShouldTranslate((int)State_FieldIndex.Name) ?? true))
            {
                if (!string.Equals(lhs.Name, rhs.Name)) return false;
            }
            if ((crystal?.GetShouldTranslate((int)State_FieldIndex.Functions) ?? true))
            {
                if (!lhs.Functions.SequenceEqualNullable(rhs.Functions)) return false;
            }
            return true;
        }
        
        public virtual int GetHashCode(IStateGetter item)
